class Solution:
    def dailyTemperatures(self, T):
        days = []
        zeroDays = {}
        for i, temp in enumerate(T):
            temps = []
            temps.append(temp)
            currentDays = 0
            if temp in zeroDays:
                days.append(0)
                continue

            for j, temp2 in enumerate(T[i + 1::]):
                currentDays += 1
                temps.append(temp2)
                if temp2 > temps[0]:
                    days.append(currentDays)
                    temps = []
                    currentDays = 0
                    break
            if len(temps) > 0:
                days.append(0)
                zeroDays[temp] = None

        return days


soln = Solution()
print(soln.dailyTemperatures(T))
